import logo from './logo.svg';
import './App.css';
import Carrousel from './components/carrousel'
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'

function App() {
  return (
    <>
      <Router>
        <Navbar/>
        <Switch>
          <Route path='/'/>
        </Switch>
      </Router>

      <Carrousel/>
    </>
  );
}

export default App;
